import { ChatGoogle } from "@langchain/google-gauth";
/**
 * Integration with a Google Vertex AI chat model using
 * the "@langchain/google-gauth" package for auth.
 */
export class ChatVertexAI extends ChatGoogle {
    static lc_name() {
        return "ChatVertexAI";
    }
    constructor(fields) {
        super({
            ...fields,
            platformType: "gcp",
        });
    }
}
